import React, { useState, useEffect } from "react";

const ContentPage = () => {

  const [content, setContent] = useState(null);

  useEffect(() => {
    fetch("localhost:8080/content")
      .then(results => results.json())
      .then(results => {
        const contentObj = results[0];
        setContent(contentObj.message);
      });
  }, []);

  return (
    <p>{content}</p>
  );
};

export default ContentPage;
